import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to be rendered by the script
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click on the first product card to open the modal
    const firstProductCard = page.locator('.product-card').first();
    await firstProductCard.click();

    // Wait for the modal to be visible
    const modal = page.locator('#productModal');
    await modal.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract the title from the product detail modal
    const modalTitleElement = page.locator('.product-detail-title');
    const modalTitle = await modalTitleElement.textContent();

    return {
      success: true,
      action: "Opened the product detail modal and extracted the product title.",
      extractedData: {
        productTitleInModal: modalTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
